export default function App() {
  return (
    <div className="App">
      <Nav />
      <ContentContainer>
        <HomePage />
        {/* <AboutUsPage /> */}
        {/* <ContactUsPage /> */}
      </ContentContainer>

      <Footer />
    </div>
  );
}
